import { createStyles, ListItem, ListItemText, Tooltip, withStyles } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import React from 'react';
import { Spell } from '../models/spell';

export const ResultRenderer: React.FunctionComponent<{type: string, data: any}> = (props) => {
    const { data } = props;
    switch (props.type) {
        case 'spells':
            const spell: Spell = data as Spell;
            return (
                <>
                    <h3>{spell.name}</h3>
                    <p>{spell.school}{spell.subschool ? ':'+spell.subschool : ''}</p>
                    <p>{spell.descriptor}</p>
                    <p>{spell.description}</p>
                    <p>{spell.components}</p>
                    <p>{spell.costlyComponents}</p>
                </>
            );
        case 'feats':
            return <p>feat: {data.name}</p>
        case 'monsters':
            return <p>monster: {data.name}</p>
        case 'items':
            return <p>item: {data.name}</p>
        default:
        return null;
    }
}
